// src/components/Partners.js
import React from 'react';
import './Partners.css';

const Partners = () => {
  const partners = [
    { name: "CLINIQUE ABSA", logo: "data:image/jpeg;base64," },
    { name: "CLINIQUE MOHAMED RASSOUL", logo: "data:image/jpeg;base64," },
    { name: "PHARMACIE DIOR", logo: "data:image/jpeg;base64," },
    { name: "HOPITAL RICHARD TOLL", logo: "data:image/jpeg;base64," },
  ];

  return (
    <div className="partners">
      <h2>Nos Partenaires</h2>
      <div className="partners-list">
        {partners.map((partner, index) => (
          <img key={index} src={partner.logo} alt={partner.name} className="partner-logo" />
        ))}
      </div>
    </div>
  );
};

export default Partners;
